import React from "react";
import { Button } from "../Button";
import "./About.css";
import "../../App.css";

function About() {
  return (
    <div className="about-container">
      <div className="row">
        <div className="col">
          <div className="about-header">
            <h2>Engineer</h2>
            <h2>Web Developer</h2>
            <h2>Photographer</h2>
          </div>
        </div>
        <div className="col">
          <h3>About Me</h3>
          <p>i am a big booty guy</p>
        </div>
      </div>
    </div>
  );
}

export default About;
